import GlobalLayout from '../components/GlobalLayout.js'
import { withRouter } from 'next/router'

function About(props) {
    var component = props.router.query.component + '';
    component = component.charAt(0).toUpperCase() + component.slice(1);

    const Comp = JSON.stringify(require('../components/' + component + '.js'));

    return (
        <GlobalLayout>
            <div>
                <p>This is the about page {props.router.query.page}</p>
            </div>
            <Comp></Comp>
        </GlobalLayout>
    );
}

export default withRouter(About)
